INSERT INTO `termo` (`id`, `tipoTermo`, `nome`, `nomeVariavel`, `conceito`, `dataInclusao`) VALUES
(7, 'teórico', 'Termos teste ', 'Termo teste2', 'Termo teste para inserção no BD', '2022-01-25'),
(8, 'conceito', 'Termo teste', 'Termo teste1', 'Termo teste', '2022-01-25'),
(9, 'conceito', 'Estrutura Social', 'Estrutura Social', 'padrões de interação entre indivíduos ou grupos. A maioria das nossas atividades é estruturada: elas são organizadas de maneira regular e repetitiva (GIDDENS, 2012). “Padrões estáveis de relações sociais” (BRYM et al., 2008, p.34). “Regras que nos regem independentemente da consciência que temos delas” (SILVA et al., 2016, p.41). “São os princípios segundo os quais não pensamos ao agir e falar, mas sem os quais não estabelecemos relações sociais, não nos comunicamos” (idem). Por exemplo, quando você fala uma frase qualquer, você respeita um conjunto de regras gramaticais, sem perceber. Você coloca o “s” no final das expressões para destacar o plural. Mas você não está pensando, “preciso colocar o ‘s’ nesta palavra para a correta concordância”. Você simplesmente faz porque a estrutura gramatical está internalizada em você. De forma equivalente, a estrutura social estabelece padrões para nossas ações e para a organização social. A estrutura social é determinada pelo modo como se organizam os aspectos econômico, cultural, social, político e histórico de uma sociedade. A sociedade brasileira, por exemplo, fundou-se sobre as bases do trabalho escravo, do patrimonialismo e do patriarcalismo. A estrutura social é mais estável do que a cultura, mas isso não significa que ela nunca muda ou nunca varia. ', '2022-01-26'),
(10, 'conceito', 'Sistema Social', 'Sistema Social', 'um sistema pode ser definido como um conjunto de elementos ou partes interdependentes que podemos considerar como um todo. Um sistema social é conjunto de indivíduos, grupos ou instituições sociais que formam um todo, uma unidade social. Trata-se de qualquer conjunto interdependente de elementos culturais e estruturais que podem ser considerados uma unidade. Um sistema social pode ser gigante, pequeno, simples, complexo (JOHNSON, 1997).  Sistema Social também pode ser definido como “conjunto de partes interdependentes, formando uma unidade funcional (isto é, tendo em vista suas finalidades, aspectos evolutivos, utilidade e equilíbrio) - tais como grupos sociais, organizações, e sociedades, que podem ser descritas em termos de estruturas e processos” (SCURO, 2004, p.246). Trata-se do “conjunto formado pela interação de diferentes elementos da sociedade, de tal modo que qualquer alteração em um elemento interfere no desempenho do todo. É um conceito utilizado para conceber a sociedade como se fosse formada por diferentes partes que estabelecem interdependência entre si (SILVA, et al., 2013, p. 21). Uma escola, uma rede escolar, uma família, um time de futebol, uma loja, uma organização empresarial, um grupo de amigos, o exército, um governo, as Nações Unidas, a economia mundial, uma sociedade, são exemplos de sistemas sociais. O sociólogo norte americano Talcott Parsons (1902-1979) deu relevância ao conceito de Sistema Sociais ao defender que “a sociedade encontra-se bem integrada e em equilíbrio quando as famílias educam bem as novas gerações, quando os militares defendem satisfatoriamente a sociedade de ameaças externas, quando as escolas ensinam às crianças as habilidades e os valores de que elas precisam para funcionar como adultos produtivos e quando as religiões criam um código moral compartilhado pelas pessoas” (PARSONS, 1951).\r\n', '2022-01-26');

